// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./WalletAuthority.sol";

// 1. Write a scalable multi-signature wallet contract, which requires a minimum of 60% authorisation
// by the signatory wallets to perform a transaction.

// 2. Write an access registry contract that stores the signatories of this multi-sig wallet by
//  address. This access registry contract will have its own admin. Further, the access registry co
// ntract must be capable of adding, revoking, renouncing, and transfer of signatory functionalities.

contract MultisigWallet is WalletAuthority {
    event SubmitTransaction(
        uint256 amount,
        address owner,
        uint256 transactionIndex
    );
    event ConfirmTransaction(uint256 transactionIndex, address owner);
    event Executetranaction(uint256 transactionInxex, address owner);
    event RemoveConfirmation(uint256 transactionIndex, address owner);

    uint256 transactionsIndex;
    mapping(uint256 => mapping(address => bool)) isConfirmed;

    struct Transaction {
        address owner;
        uint256 amount;
        bool isExecuted;
        uint256 numOfConfirmations;
        uint256 blockNumber;
    }
    Transaction[] transactions;

    constructor() {
        walletAuthority = msg.sender;
        numberOfOwners = 0;
        maxBlockLength = 50;
    }

    modifier onlyOwner() {
        require(isOwner[msg.sender], "Only Owners can submit a transaction");
        _;
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function submitTransaction(uint256 _amount, address _owner)
        public
        onlyOwner
        returns (uint256)
    {
        uint256 index = transactions.length;
        transactions.push(
            Transaction({
                owner: _owner,
                amount: _amount,
                isExecuted: false,
                numOfConfirmations: 0,
                blockNumber: block.number
            })
        );
        emit SubmitTransaction(_amount, _owner, index);
        return index;
    }

    function confirmTransaction(uint256 _transactionIndex) public onlyOwner {
        require(
            transactions.length > _transactionIndex,
            "Transaction does not exist"
        );
        require(
            !isConfirmed[_transactionIndex][msg.sender],
            "This address has already confirmed the transaction"
        );
        Transaction storage transaction = transactions[_transactionIndex];
        require(!transaction.isExecuted, "Transaction is already Executed");
        transaction.numOfConfirmations += 1;
        emit ConfirmTransaction(transactionsIndex, msg.sender);
    }

    function executeTransaction(uint256 _transactionIndex)
        public
        payable
        onlyOwner
    {
        require(
            transactions.length > _transactionIndex,
            "Transaction does not exist"
        );
        Transaction storage transaction = transactions[_transactionIndex];
        // require(
        //     (transaction.blockNumber - block.number) <= maxBlockLength,
        //     "Transaction is Closed"
        // );
        require(!transaction.isExecuted, "Transaction is already Executed");
        require(
            transaction.numOfConfirmations >= confirmationsRequired,
            "Not enough confirmations"
        );
        transaction.isExecuted = true;
        (bool success, ) = transaction.owner.call{value: msg.value}("");
        require(success, "Transaction Failed");
        emit Executetranaction(_transactionIndex, transaction.owner);
    }

    function removeConfirmation(uint256 _transactionIndex) public onlyOwner {
        require(
            transactions.length > _transactionIndex,
            "Transaction does not exist"
        );
        require(
            isConfirmed[_transactionIndex][msg.sender],
            "This address has not confirmed the transaction"
        );
        Transaction storage transaction = transactions[_transactionIndex];
        require(!transaction.isExecuted, "Transaction is already Executed");
        transaction.numOfConfirmations -= 1;
        isConfirmed[_transactionIndex][msg.sender] = false;
        emit RemoveConfirmation(_transactionIndex, msg.sender);
    }
}
